--functions
function random(x, y)
    x = x or 0; y = y or 0
    math.randomseed(os.time() * math.random(1000, 1000000))
    r = r + tonumber(math.random(1000, 1000000))
    if x == 0 and y == 0 then math.randomseed(r) if (math.random(r) % 2) == 1 then return 1 else return 0 end
    elseif not (x == 0) and y == 0 then math.randomseed(r) return math.random(x)
    else math.randomseed(r) return math.random(x, y) end
end

function GenerateTables()
    startedSudoku, mainTable, tempTable = {},{},{}
    for i = 1, 3 do local n = i
        for j = 1, 3 do
            mainTable[(i-1)*3+j] = {}
            tempTable[(i-1)*3+j] = {}
            startedSudoku[(i-1)*3+j] = {}
            for l = 1, 9 do
                mainTable[(i-1)*3+j][l] = n
                tempTable[(i-1)*3+j][l] = n
                startedSudoku[(i-1)*3+j][l] = n
                n = n + 1 if n >= 10 then n = n-9 end end
            n = n + 3; if n >= 10 then n = n-9 end
    end end
end
function MixTable(type)
    if type == 0 then
        local ttempTable,tmainTable,tstartedSudoku = {},{},{}
        for i = 1, 9 do ttempTable[i],tmainTable[i],tstartedSudoku[i]={},{},{}
            for j = 1, 9 do ttempTable[i][j],tmainTable[i][j],tstartedSudoku[i][j] = tempTable[j][i],mainTable[j][i],startedSudoku[j][i] end end
    elseif type == 1 then local a = random(1, 3)
        for i = 1, 9 do
            local tm, tmm = tempTable[(a-1)*3+3],tempTable[(a-1)*3+1]
            local ttm, ttmm = mainTable[(a-1)*3+3],mainTable[(a-1)*3+1]
            local tsm, tsmm = startedSudoku[(a-1)*3+3],startedSudoku[(a-1)*3+1]
            tempTable[(a-1)*3+1],tempTable[(a-1)*3+3] = tm,tmm
            mainTable[(a-1)*3+1],mainTable[(a-1)*3+3] = ttm, ttmm
            startedSudoku[(a-1)*3+1],startedSudoku[(a-1)*3+3] = tsm, tsmm
        end
    elseif type == 2 then local a = random(1, 3)
        for i = 1, 9 do
            local tm, tmm = mainTable[i][(a-1)*3+3],mainTable[i][(a-1)*3+1]
            local ttm, ttmm = tempTable[i][(a-1)*3+3],tempTable[i][(a-1)*3+1]
            local tsm, tsmm = startedSudoku[i][(a-1)*3+3],startedSudoku[i][(a-1)*3+1]
            mainTable[i][(a-1)*3+1],mainTable[i][(a-1)*3+3] = tm, tmm
            tempTable[i][(a-1)*3+1],tempTable[i][(a-1)*3+3] = ttm, ttmm
            startedSudoku[i][(a-1)*3+1],startedSudoku[i][(a-1)*3+3] = tsm, tsmm
        end
    elseif type == 3 then local a,b
        if random(0,1) == 1 then a=random(1,2) b=a+1 else a,b = 1,3 end
        if random(0,1) == 1 then for i = 1, 3 do
            local tm, tmm = mainTable[(b-1)*3+i],mainTable[(a-1)*3+i]
            local ttm, ttmm = tempTable[(b-1)*3+i],tempTable[(a-1)*3+i]
            local tsm, tsmm = startedSudoku[(b-1)*3+i],startedSudoku[(a-1)*3+i]
            mainTable[(a-1)*3+i],mainTable[(b-1)*3+i] = tm, tmm
            tempTable[(a-1)*3+i],tempTable[(b-1)*3+i] = ttm, ttmm
            startedSudoku[(a-1)*3+i],startedSudoku[(b-1)*3+i] = tsm, tsmm
        end end
    end
end
function MixingTables(stages_on_dif, difficult) for j = 1, difficult do for i = 1, stages_on_dif do MixTable(random(0,3)) end end end
function StartSudoku(difficult)
	data.NotValid = {}
	data.Time = 0
	data.SelInt = 0
	data.ShowNotvalid = false
	data.Moves = {}
    difficult = tonumber(difficult) or 2
    GenerateTables()
    MixingTables(100, difficult)
    for i = 1, random((difficult+1)*9, (difficult+2)*9) do
    	::zalupa_random::
