function ConvertTime(time)
	local asd = ""
	if time <= 0 then return "0s" end
	if time > 60*60*24 then
		asd = asd..math.floor(time/60*60*24).."d "
		time = time - math.floor(time/60*60*24)*60*60*24
	end
	if time > 60*60 then
		asd = asd..math.floor(time/60*60).."h "
		time = time - math.floor(time/60*60)*60*60
	end
	if time > 60 then
		asd = asd..math.floor(time/60).."m "
		time = time - math.floor(time/60)*60
	end
	if time > 0 then asd = asd..time.."s " end
	return asd:sub(1)
end
function between(a, min, max) if a > min - max and a < max + min then return true else return false end end
function GetRadius(a)
	local minsize = math.min(data.CellSize.x, data.CellSize.y)
	a = a or 1
	if a == 0 then data.Rad = 0.0 data.EndAnim = 5 data.FirstAnim = true end
	if not data.FirstAnim then return data.Rad end
	data.FirstAnim = false
	data.Rad = data.Rad + minsize/40
	if data.Rad > minsize/2 then
		if data.EndAnim > 0 then data.EndAnim = data.EndAnim - 1
		elseif data.EndAnim == 0 then data.Rad = data.Rad - minsize/20
			if data.Rad <= minsize/2 then data.Rad = minsize/2 data.EndAnim = -1 end
		else data.Rad = minsize/2
	end end
	return data.Rad
end
