end
function imgui.TodoCheck(label, bool, a_speed, alp)
	alp = alp or 1
    local p  = imgui.GetCursorScreenPos()
    local dl = imgui.GetWindowDrawList()
    local clicked = false
    local label      = label or ""
    local outline    = 2.0
    local r          = imgui.GetTextLineHeightWithSpacing() / 2
    local s          = a_speed or 0.2
    local style = imgui.GetStyle()
    local colors = style.Colors
    local clr = imgui.Col
    local function ImSaturate(f) return f < 0.0 and 0.0 or (f > 1.0 and 1.0 or f) end
    if imgui.InvisibleButton(label, imgui.ImVec2(r * 2, r * 2)) then
        bool[0] = not bool[0]
        LastTime[label] = os.clock()
        LastActive[label] = true
        clicked = true
    end
    local w = bool[0] and 1.0 or 0.0
    local bebra = 0.0
    if LastTime == nil then LastTime = {} end
    if LastActive == nil then LastActive = {} end
    if LastActive[label] then
        local time = os.clock() - LastTime[label]
        if time <= s then
            local anim = ImSaturate(time / s)
            w = bool[0] and anim or 1.0 - anim
            bebra = anim
        else LastActive[label] = false end
    end
    local c_color = bool[0] and imgui.ImVec4(0.92,0.46,0.14,alp) or (imgui.IsItemHovered(0) and imgui.ImVec4(1, 1, 1, 0.6*alp) or imgui.ImVec4(1, 1, 1, 0.4*alp))
    local cin_color = imgui.ImVec4(0.92,0.46,0.14,alp)
    local cline_color = imgui.ImVec4(1.00, 1.00, 1.00, w*alp)
    local cbebra_color = imgui.ImVec4(1.00, 1.00, 1.00, (1 - bebra) * 0.2*alp)
    dl:AddCircleFilled(imgui.ImVec2(p.x + r, p.y + r), r * bebra * 2, imgui.GetColorU32Vec4(cbebra_color), r + 5, outline)
    dl:AddCircleFilled(imgui.ImVec2(p.x + r, p.y + r), r * w, imgui.GetColorU32Vec4(cin_color), r + 5)
    dl:AddCircle(imgui.ImVec2(p.x + r, p.y + r), r, imgui.GetColorU32Vec4(c_color), r + 5, outline)
    dl:AddLine(imgui.ImVec2(p.x + r, p.y + w * (r + r / 2)), imgui.ImVec2(p.x, p.y + w * (r / 2)), imgui.GetColorU32Vec4(cline_color), outline)
    dl:AddLine(imgui.ImVec2(p.x + r, p.y + w * (r + r / 2)), imgui.ImVec2(p.x + w * (r + r / 2), p.y + w * (r / 2)), imgui.GetColorU32Vec4(cline_color), outline)
    dl:AddText(imgui.ImVec2(p.x + r * 2.7, p.y + r - (r / 2) - (imgui.CalcTextSize(label).y / 4)), imgui.GetColorU32Vec4(imgui.ImVec4(1 , 1, 1, alp)), label)
    return clicked
end
