function CheckWin()
	for i = 1, 9 do
		for j = 1, 9 do 
			if type(tempTable[i][j]) == "table" then return false end
			if tempTable[i][j] ~= mainTable[i][j] then return false end
	end end
	return true
end
function FinishSudoku() data.Winner = true end
function AddMove(i, j, PredCell)
	if type(PredCell) == "number" then local a = {i, j, PredCell} table.insert(data.Moves, a)
	else local b = {}
		for i = 1, #PredCell do table.insert(b, PredCell[i]) end
		a = {i, j, b} table.insert(data.Moves, a)
end end
function ResetSudoku()
	data.NotValid = {}
	data.SelInt = 0
	data.ShowNotvalid = false
	data.Moves = {}
	for i = 1, 9 do
		for j = 1, 9 do
			if startedSudoku[i][j] == 0 then tempTable[i][j] = 0
end end end end
function BackMove()
	if #data.Moves == 0 then return false end
	tempTable[data.Moves[#data.Moves][1]][data.Moves[#data.Moves][2]] = data.Moves[#data.Moves][3]
	data.Moves[#data.Moves] = nil
end
function Validation()
		data.NotValid = {}
		data.SelInt = 0
		data.ShowNotvalid = true
		for i = 1, 9 do
			for j = 1, 9 do
				if type(tempTable[i][j]) == "number" then
					if tempTable[i][j] ~= 0 and tempTable[i][j] ~= mainTable[i][j] then table.insert(data.NotValid, {i,j})
		end end end end
		if #data.NotValid == 0 then data.ValidAnim[0] = true
		else GetRadius(0) end
end
